import { Typography } from '@material-ui/core';

import React from 'react';

type Props = {
    title: string;
}

const ThreadView: React.FC<Props> = ({ title }: Props) => {
    return (
            <Typography variant='h4' align='left'>
                {title}
            </Typography>
    );
};

export default ThreadView;
